import './App.css';
import data from './data';
import Display from './Display';

function App() {

 function printConsole() {
    data.forEach(function (item) {
      console.log(item.name, item.price, item.pictures, item.seller, item.location, item.rate);
    })
  };


  return (
    <div className="App">

      <section>

      <div>
        <Display name={data[0].name}
          price={data[0].price}
          pictures={data[0].pictures}
          seller={data[0].seller}
          location={data[0].location}
          rate={data[0].rate}  
          />
      </div>

      </section>

    <section>

      <div>
        <Display name={data[1].name} 
        price={data[1].price} 
        pictures={data[1].pictures}
        seller={data[1].seller}
          location={data[1].location}
          rate={data[1].rate} />
      </div>

    </section>

      <section>

      <div>
        <Display name={data[2].name} 
        price={data[2].price} 
        pictures={data[2].pictures}
        seller={data[2].seller}
          location={data[2].location}
          rate={data[2].rate} />
      </div>


      </section>

<section>

  <div>
    <Display 
      name={data[3].name} 
      price={data[3].price} 
      pictures={data[3].pictures}
      seller={data[3].seller}
      location={data[3].location}
      rate={data[3].rate} 
    />
  </div>

</section>

<section>

      <div>
        <Display name={data[4].name}
        price={data[4].price}
        pictures={data[4].pictures}
        seller={data[4].seller}
          location={data[4].location}
          rate={data[4].rate} />
      </div>



</section>

    </div>
  );
}

export default App;
